column14:
/*similar for closed: start*/
.close-label {
    display: flex;
    align-self: center;
    text-transform: uppercase;
    padding: 7px 16px;
    color: #fff;
    background-color: #B61B23;
    border-radius: 5px;
    line-height: 1;
    font-weight: 500;
    font-family: 'Roboto', 'Helvetica Neue', 'Arial', sans-serif;
    font-size: 13px;
}

.similar-for-closed {
    background-color: #F2F2F2;
    padding: 15px 20px 2px;
    margin-bottom: 20px;
}

.similar-for-closed__title {
    color: #000;
    font-weight: 500;
    font-size: 20px;
    margin-bottom: -2px;
    font-family: 'Akrobat-Bold','Helvetica Neue','Arial',sans-serif;
}

.similar-for-closed .div_h2 {
    margin-bottom: 20px;
    font-size: 20px;
    font-family: 'Akrobat-Bold','Helvetica Neue','Arial',sans-serif;
}

.similar-for-closed__title, .similar-for-closed .div_h2 {
    display: inline-block;
}

.similar-for-closed .small_list {
    flex-direction: row;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
}

.similar-for-closed .small_list .item {
    padding-right: 0;
    padding-top: 0;
    padding-bottom: 15px;
    width: 49%;
    margin-right: 2%;
    flex: none;
    display: flex;
}

.similar-for-closed .small_list .item:nth-child(2n) {margin-right: 0;}

.similar-for-closed .item .pic_wrapper {
    width: 80px;
    height: 80px;
    margin-right: 10px;
    border: none;
    flex-shrink: 0;
}

.small_list .item .pic_wrapper img {
    display: block;
    width: 100%;
    height: 100%;
}

.similar-for-closed .small_list .overflow {
    top: auto;
    padding-top: 4px;
    flex: 1;
    position: relative;
}

.similar-for-closed .item .rest_title {
    font-family: 'Roboto', 'Helvetica Neue', sans-serif;
    font-weight: 700;
    font-size: 16px;
    padding-right: 40px;
    white-space: normal;
    display: -webkit-box;
    -webkit-box-orient: vertical;
    -webkit-line-clamp: 2;
    color: #272727;
}

.similar-for-closed .item.no-cost .rest_title {
    padding-right: 0;
}

.similar-for-closed div.number {
    color: #272727;
    margin-top: 4px;
    margin-bottom: 2px;
    margin-right: 0;
    line-height: 1.2;
}

.similar-for-closed .distance {
    color: #70757a;
    line-height: 1.2;
    font-size: 13px;
    margin-bottom: 3px;
    padding-left: 15px;
    background: url('data:image/svg+xml;charset=utf-8,%3Csvg%20width%3D%2211%22%20height%3D%2211%22%20viewBox%3D%220%200%2011%2011%22%20fill%3D%22none%22%20xmlns%3D%22http%3A%2F%2Fwww.w3.org%2F2000%2Fsvg%22%3E%0A%3Cpath%20d%3D%22M8.15%201.40682L2.63%204.15682L0%205.45682L3.875%206.61182L5%2010.4868L6.31%207.86682L9.08%202.32682L10%200.486816L8.15%201.40682Z%22%20fill%3D%22%23868789%22%2F%3E%0A%3C%2Fsvg%3E%0A') no-repeat left center;
}

.similar-for-closed .cost {
    font: 14px 'Roboto', 'Helvetica Neue', sans-serif;
    /*color: #70757A;*/
    position: absolute;
    right: 0;
    top: 3px;
}

/*.similar-for-closed .cost i {*/
/*    color: #272727;*/
/*}*/

.similar-for-closed .work-time__open,
.similar-for-closed .work-time__closed {
    font-size: 13px;
    font-weight: 500;
}

.similar-for-closed .work-time__open {color: #449320;}
.similar-for-closed .work-time__closed {color: #B61B23;}

/*@media screen and (max-width: 1100px) {*/
/*    .similar-for-closed .small_list .item {width: 49%;}*/
/*}*/

@media screen and (max-width: 940px) {
    .similar-for-closed .small_list .item {
        width: 100%;
        margin-right: 0;
    }
}

@media screen and (max-width: 740px) {
    .similar-for-closed__title, .similar-for-closed .div_h2 {
        display: block;
    }
    .similar-for-closed {
        padding: 7px 10px 0;
        margin-top: 2px;
    }
    .similar-for-closed .div_h2 {margin-bottom: 15px;}
    .similar-for-closed .small_list .item {padding-bottom: 13px;}
    .similar-for-closed .item .pic_wrapper {
        width: 85px;
        height: 85px;
    }
    .similar-for-closed .small_list .overflow {
        padding-top: 1px;
    }
    .similar-for-closed div.number {
        margin-top: 4px;
    }
    .similar-for-closed .distance {
        margin-bottom: 0;
    }
    .similar-for-closed .cost {
        top: -1px;
    }
}

@media screen and (max-width: 530px) {
    .similar-for-closed {margin-top: 8px;}
}
/*similar for closed: end*/
